TLDR;
Higher tier does not  guarantee higher incentive. It is not static, but rather dynamic. 

This is because the reward system completely merit based, the best performing miners will have the best incentive, period. In this case, the miner with the lower tier is performing more optimally than the miner with higher tier, and will rapidly ascend to that tier as soon as the qualifications are met (e.g. total successes and success rate)

